   /**
      * Returns if board is valid
     * @param String json
     * @return boolean
     */
    
  
  public boolean isRowValid(Object [][] board, int i, int j){
    while(j>=0){
      if(board[i][j]==board[i][j-1]){
        return false;
      }
      else{
        j--;
      }
    }
    while(j<9){
      if(board[i][j]==board[i][j+1]){
        return false;
      }
      else{
        j++;
      }
    }
    return true;
  }
         
  public boolean isColValid(Object [][] board, int i, int j){
    while(i>=0){
      if(board[i][j]==board[i-1][j]){
        return false;
      }
      else{
        i--;
      }
    }
    while(i<9){
      if(board[i][j]==board[i+1][j]){
        return false;
      }
      else{
        i++;
      }
    }
    return true;
  }
         
  public boolean isSubBoardValid(Object [][] board, int i, int j){
    int row= i/3;
    int col=j/3;
    for(int a=0;a<3;a++){
      for(int b=0;b<3;b++){
        if(i!=row+a || j!=col+b){
          if(board[i][j]==board[row+a][row+b]){
            return false;
          }
        }
        
      }
    }
    return true;
  }  

  public boolean validate(Object [][] board) {
        for (int i=0;i<9;i++){
          for (int j=0;j<9;j++){
            if(isRowValid(board,i,j) && isColValid(board,i,j) && isSubBoardValid(board,i,j)){
              return true;
            }
          }
        }
      
        return false;
    }













