    private static Object[][] parseBoard(String json) throws Exception {
        Object[][] board = new Object[9][9];
        JSONParser jp = new JSONParser();
        JSONArray ar = (JSONArray)jp.parse(json);

        Iterator i = ar.iterator();
        int rowCount = 0;
        int colCount = 0;

        while(i.hasNext()) {

            JSONArray row = (JSONArray)i.next();
            Iterator colI = row.iterator();
            while(colI.hasNext()) {
                board[rowCount][colCount] = colI.next();
                colCount++;
            }
            colCount = 0;
            rowCount++;
        }        
        return board;
    }


